import React from 'react';
import Card from './Card/Card'

class UserMiniCard extends React.Component {

    constructor(props) {
        super(props);
        const users = this.props.users;
    }

    render() {
        console.log(this.users);
        this.users.map((user, i) => {
            return (
                <Card
                    user={user}
                    key={i}
                />
            )
        });
        return null;
    }
}
export default UserMiniCard;
